		// \u521B\u5EFA\u7BA1\u9053\u65F6\u9700\u8981\u5728 mode \u53C2\u6570\u4F4D\u7F6E\u4F20 S_IFIFO,\u8868\u660E\u521B\u5EFA\u7684\u662F\u547D\u540D\u7BA1\u9053
